Luos is like a task that has to be run regularly. So you will have to run it by adding luos_init() and luos_loop() in the main() of your program. Basically, your main() will look like this: #include "luos.h" int main(void)
{ luos_init(); while(1) { luos_loop(); } return 0;
} Putting this code into a nodeHardware element (MCU) hosting and running Luos and hosting one or several modules. makes it able to react to a Luos network. It's now ready to host your modules. As a developer you will always develop your functionalities into modules and never into the main() program. Note: The only information that should be put on the main() code are MCU setup parameters and modules' run functions.

