In order to communicate from a computer to a Luos network through a gate, a serial connection can be established. This serial connectivity must have the following parameters: Baudrate: 1,000,000 Bits/s 8 Bits per transfer 1 stop bit No parity bit Least significant bit sent first Non inverted Although the connection can be made with Pyluos, the Python library, other languages can be used on the computer side. Here is a C Linux serial connection example: void init_luos_comm(luos_t* m)
{ m->serial_fd = open(SERIAL_PORT, O_RDWR); // Check for errors if (m->serial_fd < 0) { printf("Error %i from open: %s
", errno, strerror(errno)); return -1; } struct termios tty; memset(&tty, 0, sizeof tty); if (tcgetattr(m->serial_fd, &tty) != 0) { printf("Error %i from tcgetattr: %s
", errno, strerror(errno)); return -1; } tty.c_cflag &= ~PARENB; // Disable parity tty.c_cflag &= ~CSTOPB; // Clear stop field tty.c_cflag |= CS8; // 8 bits per byte tty.c_cflag &= ~CRTSCTS; // Disable RTS/CTS hardware flow control tty.c_cflag |= CREAD | CLOCAL; // Turn on READ & ignore ctrl lines (CLOCAL = 1) tty.c_lflag &= ~ICANON; // Disable canonical mode tty.c_lflag &= ~ECHO; // Disable echo tty.c_lflag &= ~ECHOE; // Disable erasure tty.c_lflag &= ~ECHONL; // Disable new-line echo tty.c_lflag &= ~ISIG; // Disable interpretation of INTR, QUIT and SUSP // Turn off s/w flow ctrl tty.c_iflag &= ~(IXON | IXOFF | IXANY); // Disable any special handling of received bytes tty.c_iflag &= ~(IGNBRK|BRKINT|PARMRK|ISTRIP|INLCR|IGNCR|ICRNL); // Prevent special interpretation of output bytes (e.g. newline chars) tty.c_oflag &= ~OPOST; // Prevent conversion of newline to carriage return/line feed tty.c_oflag &= ~ONLCR; // Wait for up to 1s (10 deciseconds), returning as soon as any data is received. tty.c_cc[VTIME] = 10; tty.c_cc[VMIN] = 0; // Set in/out baud rate to be 1000000 cfsetispeed(&tty, B1000000); cfsetospeed(&tty, B1000000); // Save tty settings if (tcsetattr(m->serial_fd, TCSANOW, &tty) != 0) { printf("Error %i from tcsetattr: %s
", errno, strerror(errno)); return -1; } fcntl(m->serial_fd, F_SETFL, FNDELAY); usleep(500000);
}

