Luos provides a standard command to ask a module to retrieve values from a sensor, called ASK_PUB_CMD. However, sometimes apps need to poll values from sensors, but the act of repeatedly retriving a value using the ASK_PUB_CMD command may result in the use of a lot bandwidth and take useless resources. In this kind of polling situation, you can use the time-triggered auto-update features available from any Luos module . This feature allows you to ask a module to send you an update of any value each X milliseconds. To use it, you have to setup targeted module with a message containing a standard time object dictionarySet of objects based on SI metric system that can be transmitted through Luos messages. Any object can easily be converted in other units., but with a specific command associated to it. For example, to update a module each 10ms: time_luos_t time = time_from_ms(10);
msg_t msg;
msg.header.target = id;
msg.header.target_mode = IDACK;
time_to_msg(&time, &msg);
msg.header.cmd = UPDATE_PUB;
luos_send(app, &msg); Info: Modules can handle only one time-triggered target, 2 modules of the same network can't ask a time-triggered value from the same module. Warning: To prevent any ID movement, auto-update configuration is reseted on all modules at each detection (see Routing table page for more information). Edit this page

