This configuration is the default and most common setup. In this configuration, Luos calls the module callback during runtime (not interrupt). The time between the physical reception of a message and the callback may vary depending on the luos_loop() function call frequency. With this configuration, you have no real constraints on the callback's time of execution, you can reply to a message directly on the callback. To setup this configuration you have to simply setup the callback at module creation. Here is a code example with a button: void rx_btn_cb(module_t *module, msg_t *msg) { if (msg->header.cmd == ASK_PUB_CMD) { // The message is filled with global variable with proper data msg_t pub_msg; pub_msg.header.cmd = IO_STATE; pub_msg.header.target_mode = ID; pub_msg.header.target = msg->header.source; pub_msg.header.size = sizeof(char); pub_msg.data[0] = HAL_GPIO_ReadPin(BTN_GPIO_Port, BTN_Pin); // Sending the message luos_send(module, &pub_msg); return; }
} void button_init(void) { // module creation: (callback, module type, Default alias) module_t* module = luos_module_create(rx_btn_cb, STATE_MOD, "button_mod");
} void button_loop(void) {
