This method is adapted to high-frequency messages updates and requires an advanced understanding of embedded code and hardware capabilities. This configuration is not set by default. In this configuration, module's callback is called in interruption. It means that if the execution time is too long into module's callback, it will block all the other interruptions and any other messages reception. The callback execution must be ended before any new message. With this configuration you don't have time to send a reply back in the callaback. The response will then have to be deported into the main loop. In order to use this configuration, you have to setup the callback at module creation and enable the real time mode. Here is a code example with a button: static module_t *module_pointer;
static volatile msg_t pub_msg;
static volatile int pub = LUOS_PROTOCOL_NB; void rx_btn_cb(module_t *module, msg_t *msg) { // /!\ execution in interruption if (msg->header.cmd == ASK_PUB_CMD) { // The message is filled with global variable with proper data pub_msg.header.cmd = IO_STATE; pub_msg.header.target_mode = ID; pub_msg.header.target = msg->header.source; pub_msg.header.size = sizeof(char); pub_msg.data[0] = HAL_GPIO_ReadPin(BTN_GPIO_Port, BTN_Pin); // The request is saved to be executed into the regular program pub = ASK_PUB_CMD; module_pointer = module; return; }
} void button_init(void) { // module creation: (callback, module type, Default alias) module_t* module = luos_module_create(rx_btn_cb, STATE_MOD, "button_mod"); // Hard real-time activation luos_module_enable_rt(module);
} void button_loop(void) { if (pub != LUOS_PROTOCOL_NB) { // Sending the generated message into the callback luos_send(module_pointer, &pub_msg); pub = LUOS_PROTOCOL_NB; }
} Edit this page

